PROOF 5 (source file [https://raw.githubusercontent.com/eyereasoner/eye/master/reasoning/socrates/socrates-proof.n3]): 
----------------------------------------------------------------------------------------------------@prefix skolem: <http://eyereasoner.github.io/.well-known/genid/8b98b360-9a70-4845-b52c-c675af60ad01#>.
@prefix r: <http://www.w3.org/2000/10/swap/reason#>.
@prefix : <http://example.org/socrates#>.
@prefix n3: <http://www.w3.org/2004/06/rei#>.
@prefix var: <http://www.w3.org/2000/10/swap/var#>.
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#>.

skolem:proof a r:Proof, r:Conjunction;
    r:component skolem:lemma1;
    r:component skolem:lemma2;
    r:gives {
        :Socrates a :Human.
        :Socrates a :Mortal.
    }.

skolem:lemma1 a r:Inference;
    r:gives {
        :Socrates a :Human.
    };
    r:evidence (
        skolem:lemma3
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo [ n3:uri "http://example.org/socrates#Human"]];
    r:rule skolem:lemma4.

skolem:lemma2 a r:Inference;
    r:gives {
        :Socrates a :Mortal.
    };
    r:evidence (
        skolem:lemma5
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo [ n3:uri "http://example.org/socrates#Mortal"]];
    r:rule skolem:lemma4.

skolem:lemma3 a r:Extraction;
    r:gives {
        :Socrates a :Human.
    };
    r:because [ a r:Parsing; r:source <http://eyereasoner.github.io/eye/reasoning/socrates/socrates.n3>].

skolem:lemma4 a r:Extraction;
    r:gives {
        @forAll var:x_0. {
            :Socrates a var:x_0.
        } => {
            :Socrates a var:x_0.
        }.
    };
    r:because [ a r:Parsing; r:source <http://eyereasoner.github.io/eye/reasoning/socrates/socrates-query.n3>].

skolem:lemma5 a r:Inference;
    r:gives {
        :Socrates a :Mortal.
    };
    r:evidence (
        skolem:lemma6
        skolem:lemma3
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo [ n3:uri "http://example.org/socrates#Human"]];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_1"]; r:boundTo [ n3:uri "http://example.org/socrates#Mortal"]];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_2"]; r:boundTo [ n3:uri "http://example.org/socrates#Socrates"]];
    r:rule skolem:lemma7.

skolem:lemma6 a r:Extraction;
    r:gives {
        :Human rdfs:subClassOf :Mortal.
    };
    r:because [ a r:Parsing; r:source <http://eyereasoner.github.io/eye/reasoning/socrates/socrates.n3>].

skolem:lemma7 a r:Extraction;
    r:gives {
        @forAll var:x_0, var:x_1, var:x_2. {
            var:x_0 rdfs:subClassOf var:x_1.
            var:x_2 a var:x_0.
        } => {
            var:x_2 a var:x_1.
        }.
    };
    r:because [ a r:Parsing; r:source <http://eyereasoner.github.io/eye/reasoning/socrates/socrates.n3>].


